  "text" : "\uC0AC\uC2E4 \uC800 \uC5ED\uC2DC\uB3C4 \uD3B8\uACAC\uC774\uB098 \uBB34\uC9C0\uD568\uACFC \uB17C\uB9AC\uC801 \uD5C8\uC220\uD568\uC758 \uB178\uC608\uC774\uAE34 \uD569\uB2C8\uB2E4\uB9CC, \uC2A4\uC2A4\uB85C\uAC00 \uC774\uB7EC\uD55C \uBD80\uC871\uD568\uC744 \uC778\uC815\uD558\uAE30 \uB54C\uBB38\uC5D0 \uB354\uB354\uC6B1 \uC8FC\uC758\uB97C \uAE30\uC6B8\uC774\uB824 \uB178\uB825\uD558\uB294 \uD3B8\uC774\uC5D0\uC694.\n\n\uC608\uB97C \uB4E4\uC790\uBA74 \uB9AC\uD2B8\uC717 \uB41C \uD2B8\uC717 \uD558\uB098\uB9CC \uBCF4\uACE0 \uC5F4\uBC1B\uC544\uC11C \uB300\uB738 \uBA58\uC158\uC73C\uB85C \uC9C0\uB784\uC744.. \uC544 \uC544\uB2D9\uB2C8\uB2FC\u314B\u314B\u314B\u314B\u314B",
