  "text" : "\uB0B4\uAC00 \uC5B4\uC81C \uC4F4 '\uB3D9\uC131\uC560\uC640 \uC18C\uC544\uC131\uC560\uC5D0 \uB300\uD55C \uD3B8\uACAC'\uC744 \uC800\uACA9\uD558\uB358 \uAE00\uC774 \uC0AC\uB77C\uC84C\uB2E4. \uC790\uC0AD\uD558\uC2E0 \uAC83\uC778\uAC00, \uC544\uB2C8\uBA74 \uADF8\uBD84\uC5D0\uAC8C \uBE14\uB77D\uC744 \uB2F9\uD55C \uD0D3\uC5D0 \uAC80\uC0C9\uC5D0 \uB178\uCD9C\uB418\uC9C0 \uC54A\uB294 \uAC83\uC778\uAC00.\n\n\uC774\uC57C\uAE30\uB97C \uD480\uC5B4\uB098\uAC00\uAE30 \uC704\uD574 \uC77C\uBD80\uB7EC \uD3B8\uACAC\uC744 \uC790\uADF9\uD560 \uC758\uB3C4\uB85C \uD2B8\uC717\uC744 \uD588\uC9C0\uB9CC, \uB108\uBB34 \uC2E4\uC2DC\uAC04\uC774\uB77C \uB180\uB78C.",
