  "text" : "\uB204\uAD70\uAC00\uAC00 \uC790\uC2E0\uC758 \uACAC\uD574 \uB4F1\uC744 \uB9D0\uD588\uC744 \uB54C, \uADF8\uAC83\uC774 \uC790\uC2E0\uC758 \uACAC\uD574\uC640 \uB9DE\uC9C0 \uC54A\uB294\uB2E4\uBA74 \uADF8\uB0E5 '\uC774\uD574\uAC00 \uC548\uAC04\uB2E4'\uB77C\uACE0 \uD558\uC2DC\uAC70\uB098, \uD1A0\uB860 \uB4F1\uC744 \uD1B5\uD574 \uC758\uC0AC\uB97C \uC870\uC728\uD558\uC2DC\uBA74 \uB418\uB294\uAC81\uB2C8\uB2E4. \"\uB2E5\uCCD0! \uADF8\uB7F0 \uC18C\uB9AC \uD558\uB824\uBA74 \uC785\uB3C4 \uBEE5\uB057\uD558\uC9C0 \uB9C8!\" \uC2DD\uC758 \uC811\uADFC\uC740 \uBC14\uB78C\uC9C1\uD558\uC9C0 \uC54A\uB2E4\uACE0 \uC0DD\uAC01\uD574\uC694.",
