  "text" : "\uC544\uAE4C \uC81C\uAC00 \"\uC800\uB294 ~\uB97C \uC2EB\uC5B4\uD569\uB2C8\uB2E4\uC5D0 \uC18C\uC544\uC131\uC560\uC790\uB97C \uB123\uC5B4\uBCF4\uC790\" \uB77C\uB294 \uB9D0\uC744 \uD55C \uC774\uC720\uB294, \uC18C\uC544\uC131\uC560\uC790(\uD574\uB2F9 \uC6A9\uC5B4\uC5D0 \uB17C\uC7C1 \uC788\uC74C)\uC758 \uC808\uB300\uB2E4\uC218\uAC00 \uC774\uB7EC\uD55C \uC120\uCC9C\uC801 \uC131\uC801 \uC131\uD5A5\uC744 \uC228\uAE34 \uCC44 \uC0B4\uC544\uAC00\uACE0 \uC788\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uC774\uB97C \uBE44\uB09C\uC758 \uB300\uC0C1\uC73C\uB85C \uBCF4\uB294 \uC0AC\uB78C\uC774 \uC788\uC73C\uB9AC\uB780 \uAE30\uB300 \uB54C\uBB38\uC774\uC5C8\uC8E0",
