  "text" : "\uB9AC\uD2B8\uC717\uD55C \uC815\uBCF4\uB97C \uC880 \uB9CE\uC774 \uC624\uBC84\uD574\uC11C \uB4E4\uC73C\uBA74 \"\uC0AC\uB78C\uC744 \uB54C\uB824\uC8FC\uACE0 \uC2F6\uB2E4\uBA74 \uCC28\uB77C\uB9AC \uC0C1\uB300\uB97C \uC5C6\uC560\uBC84\uB9AC\uB358\uAC00 \uD574\uC11C \uC99D\uAC70\uC870\uCC28 \uB0A8\uAE30\uC9C0 \uB9D0\uACE0 \uC644\uC804\uBC94\uC8C4\uB97C \uC800\uC9C8\uB7EC\uB77C. \uADF8\uB7EC\uBA74 \uD3ED\uD589\uC8C4 \uC548\uB428\"\uCC98\uB7FC \uC77D\uD790 \uC218\uB3C4 \uC788\uB294 \uAE00\uC774\uB77C, \uADF8\uB807\uAC8C \uC624\uBC84\uD574\uC11C \uBC1B\uC544\uB4E4\uC77C \uC0AC\uB78C\uC740 \uC5C6\uACA0\uC9C0\uB9CC \uC4F8\uB370\uC5C6\uC774 \uCCA8\uC5B8\uD574\uBD04.",
