  "text" : "\uC5EC\uD2BC, \uC544\uCE68\uBD80\uD130 \uC7AC\uBBF8\uC5C6\uB294 \uC18C\uB9AC\uB85C \uD0C0\uC784\uB77C\uC778\uC744 \uB3C4\uBC30\uD574\uC11C \uB3A8\uB449\uD568\uBBF8\uB2E4.\n\n\uC81C\uAC00 \uC544\uCE68\uB9C8\uB2E4 \uC6D0\uB450\uB97C \uAC08\uC544\uC11C \uCEE4\uD53C\uB97C \uB4DC\uB9BD\uD558\uACE0- \uAC70\uAE30\uC5D0 \uC124\uD0D5\uC774\uB098 \uC2DC\uB7FD\uC744 \uC794\uB729 \uB123\uC5B4\uC11C \uB9C8\uC2DC\uBA70 \uCE74\uD398\uC778\uACFC \uB2F9\uC744 \uC12D\uCDE8\uD574\uC57C \uD558\uB294\uB370, \uC624\uB298 \uD3EC\uD130\uBE14 \uADF8\uB77C\uC778\uB354 \uC190\uC7A1\uC774\uB97C \uBABB\uCC3E\uC544\uC11C \uD55C\uCC38\uB3D9\uC548 \uD328\uB2C9\uC5D0 \uBE60\uC84C\uC5C8\uACE0",
