  "text" : "\uAF2C\uCE58\uAF2C\uCE58 \uCE90\uBB3B\uACE0 \uB530\uC9C0\uACE0 \uB4DC\uB294 \uAC83\uC774 \uBC95\uD559\uACC4\uC774\uACE0, \uC0AC\uC2E4 \uB300\uBD80\uBD84\uC758 \uACBD\uC6B0\uC5D0 \uC774\uB7EC\uD55C \uD559\uACC4\uC758 \uC8FC\uC7A5\uC774 \uB17C\uB9AC\uC801\uC73C\uB85C \uD0C0\uB2F9\uD558\uACE0, \uAC01\uC885 \uC6D0\uCE59\uC5D0\uB3C4 \uB9DE\uB294 \uD3B8\uC778\uC9C0\uB77C.. \uC0AC\uBC95\uBD80\uC640 \uD5CC\uC7AC\uC5D0\uC11C\uB3C4 \uC5B8\uC820\uAC00\uB294 \uC774\uB7EC\uD55C \uACAC\uD574\uB4E4\uC744 \uBC1B\uC544\uB4E4\uC77C \uC218\uBC16\uC5D0 \uC5C6\uC74C. \uC774\uAC8C \uC815\uB9D0 \uC81C\uB300\uB85C \uB41C \uD310\uACB0\uC5D0 \uB300\uD55C \uBE44\uD310\uC784",
