  "text" : "\uC774\uB7EC\uD55C \uD6C4\uD559\uB4E4\uC774 \uC0AC\uBC95\uBD80\uC758 \uD310\uB2E8\uC744 \uACB0\uAD6D\uC740 \uD559\uACC4\uC758 \uC785\uC7A5\uACFC \uB3D9\uAE30\uD654 \uC2DC\uD0A4\uB294 \uC5ED\uD560\uC744 \uB9E1\uC544\uC628 \uAC83\uC740 \uBD80\uC815\uD560 \uC218 \uC5C6\uB294 \uC0AC\uC2E4\uC774\uB77C\uACE0 \uC0DD\uAC01. \uADF8\uB798\uC11C \uBC95\uD559\uACC4\uAC00 \uC911\uC694\uD55C \uAC83\uC774\uACE0, \uAC01 \uB300\uD559\uB4E4\uC758 \uBC95\uD559\uBD80 \uC874\uC18D\uACFC \uC774\uB97C \uD1B5\uD55C \uBC95\uD559\uC804\uACF5\uC790 \uC591\uC131\uC758 \uC911\uC694\uC131\uC740 \uC544\uBB34\uB9AC \uAC15\uC870\uD574\uB3C4 \uBD80\uC871\uD558\uC9C0 \uC54A\uC74C.",
