  "text" : "\uC774\uB807\uAC8C \uAC10\uC815\uC5D0 \uCE58\uC6B0\uCE58\uACE0 \uBD80\uC801\uC808\uD55C \uC0AC\uBC95\uBD80 \uBE44\uB09C\uC774 \uB4DD\uC138\uD55C\uB2E4\uBA74 \uAD6D\uBBFC\uB4E4\uC740 \uC0AC\uBC95\uCCB4\uACC4\uC5D0 \uB300\uD574 \uADFC\uAC70 \uBD80\uC871\uD55C \uBD88\uC2E0\uC744 \uAC16\uAC8C \uB420 \uAC83\uC774\uACE0, \uC774\uB294 \uC0AC\uBC95\uC815\uC758\uC758 \uD655\uBCF4\uAC00 \uC544\uB2CC- \uC900\uBC95\uC815\uC2E0\uC758 \uC545\uD654\uC640 \uBC94\uC8C4\uC728 \uC0C1\uC2B9\uC73C\uB85C \uC5F0\uACB0\uB420 \uC704\uD5D8\uC131\uC774 \uC788\uB2E4\uACE0 \uC0DD\uAC01\uD568. \uADF8\uB798\uC11C \uC774\uAC8C \uC6B0\uB824\uD560 \uBB38\uC81C\uB77C\uB294 \uAC83\uC784.",
