  "text" : "\uD558\uAE34.. \uC801\uADF9\uC801 \uD3C9\uB4F1\uC2E4\uD604\uC870\uCE58\uAC00 \uD5CC\uBC95\uC801 \uADFC\uAC70\uAC00 \uC5C6\uC774\uB3C4 \uBC1C\uB3D9\uB420 \uC218 \uC788\uB2E4\uBA70 \uB0B4\uAC8C \uC2DC\uBE44 \uAC78\uB358 \uBD84\uB3C4 \uC788\uC5C8\uACE0, \uBC95\uC870\uBB38\uC5D0 '~\uB4F1'\uC774 \uB4E4\uC5B4\uAC00\uAC70\uB098 \uAE30\uC220\uC801 \uC694\uC18C\uB97C \uBAA8\uB450 \uC9D1\uC5B4\uB123\uC9C0 \uC54A\uC558\uC73C\uBBC0\uB85C \uCC28\uBCC4\uAE08\uC9C0\uBC95\uC740 \uBA85\uD655\uC131\uC758 \uC6D0\uCE59\uC5D0 \uBC18\uD574 \uC704\uD5CC\uC774\uB77C\uBA70 \uD070\uC18C\uB9AC \uCE58\uB358 \uBD84\uB3C4 \uC788\uC5C8\uC73C\uB2C8 \uBB50 -_-",
