  "text" : "\uB2E4\uB4E4 \uB3D9\uBB38\uC774\uAC70\uB098, \uC544\uB2C8\uBA74 '\uCE5C\uAD6C\uC758 \uCE5C\uAD6C' \uC2DD\uC73C\uB85C \uC778\uB9E5\uC774 \uD615\uC131\uB418\uC5B4 \uC788\uB2E4\uBCF4\uB2C8 \uBCD1\uC601\uBD80\uC870\uB9AC\uB97C \uC800\uC9C0\uB97C \uAC04 \uD070 \uB188\uB3C4 \uAC70\uC758 \uC5C6\uC5C8\uACE0, \uADF8\uB9AC\uACE0 \"\uB0B4\uAC00 \uC5EC\uAE30\uC11C \uC720\uB09C\uD788 \uC798\uB0AC\uB2E4\"\uC2DD\uC758 \uB9C8\uC778\uB4DC\uB3C4 \uBCC4\uB85C \uC5C6\uC5C8\uB358 \uAC83 \uAC19\uB2E4. \uADF8\uAC8C \uC801\uC740 \uBCD1\uC601\uBD80\uC870\uB9AC \uBC1C\uC0DD\uC728\uC5D0 \uB300\uD55C \uCE74\uD22C\uC0AC\uB4E4\uC758 \uBD84\uC11D\uC774\uC5C8\uC74C.",
