  "text" : "\uBB3C\uB860 \uC0DD\uD65C \uD658\uACBD\uC758 \uCC28\uC774\uB3C4 \uC788\uACA0\uC9C0\uB9CC.. \uBCD1\uC0AC\uB4E4\uC774 \uC11C\uB85C\uB97C \uBB34\uC2DC\uD558\uAE30\uAC00 \uD798\uB4E4\uB2E4\uB294 \uAC83\uC774 \uAC00\uC7A5 \uD070 \uC774\uC720\uC600\uB2E4. \uC77C\uB2E8 \uD559\uB825\uB3C4 \uB2E4\uB4E4 \uBE44\uC2B7\uBE44\uC2B7\uD558\uACE0, \uACE0\uB4F1\uD559\uAD50\uB098 \uB300\uD559\uAD50 \uB3D9\uBB38\uC778 \uACBD\uC6B0\uB3C4 \uB9CE\uC558\uC73C\uBA70, \uC2EC\uC9C0\uC5B4\uB294 \uAC70\uC8FC\uC9C0\uC5ED\uB3C4 \uBE44\uC2B7\uBE44\uC2B7\uD574\uC11C \uC774\uBBF8 \uC0AC\uD68C\uC5D0\uC11C\uBD80\uD130 \uC54C\uACE0 \uC9C0\uB0B8 \uACBD\uC6B0\uAC00 \uB9CE\uC558\uC5C8\uC74C.",
