  "text" : "\uC65C \uCE74\uD22C\uC0AC\uB4E4\uC758 \uC790\uC0B4\uC0AC\uACE0\uB77C\uB358\uAC00 \uAC01\uC885 \uBCD1\uC601\uBD80\uC870\uB9AC \uC0AC\uAC74\uC758 \uBC1C\uC0DD\uC728\uC774 \uC720\uB09C\uD788 \uB0AE\uC740\uAC00\uC5D0 \uB300\uD574 \uB17C\uC758\uB97C \uD560 \uAE30\uD68C\uAC00 \uC788\uC5C8\uB2E4. \uD55C\uAD6D\uAD70 \uCE21\uC5D0\uC11C \uB098\uC628 \uC7A5\uC131\uB4E4\uC740 '\uB9C9\uC0AC \uB4F1\uC758 \uC0DD\uD65C\uD658\uACBD\uC774\uB098 \uC678\uBC15\uC678\uCD9C \uBE48\uB3C4\uC758 \uCC28\uC774\uAC00 \uC774\uC720 \uC544\uB2D0\uAE4C' \uB77C\uB294 \uC758\uBB38\uC744 \uC81C\uC2DC\uD588\uB294\uB370, \uCE74\uD22C\uC0AC\uB4E4\uC758 \uBD84\uC11D\uC740 \uB2EC\uB790\uC74C.",
