  "text" : "\uCC3E\uACA0\uB2E4\uBA70 \uC8FC\uD55C\uBBF8\uAD70\uC758 \uBCD1\uC601\uBB38\uD654, \uD2B9\uD788 \uCE74\uD22C\uC0AC\uB4E4\uC758 \uBCD1\uC601\uBB38\uD654\uB97C \uD0D0\uBC29\uD558\uACA0\uB2E4\uBA70 \uC2A4\uD0C0\uB4E4\uC774 \uB300\uAC70 \uC6A9\uC0B0\uAE30\uC9C0\uB97C \uBC29\uBB38\uD588\uC5C8\uB2E4. \uC678\uBE48(?)\uB9DE\uC774 \uC5ED\uC2DC \uB0B4 \uC784\uBB34\uC600\uAE30 \uB54C\uBB38\uC5D0, \uC0AC\uC9C4\uCD2C\uC601 \uBC0F \uC218\uD589\uC5C5\uBB34\uB97C \uB9E1\uC544 \uADF8\uB4E4\uC744 \uB530\uB77C\uB2E4\uB2C8\uAC8C \uB418\uC5C8\uC5C8\uB2E4. \uADF8\uB7EC\uB2E4\uAC00 \uCE74\uD22C\uC0AC\uB4E4\uACFC\uC758 \uD658\uB2F4\uC2DC\uAC04\uC744 \uAC16\uAC8C \uB418\uC5C8\uB294\uB370",
