  "text" : "\uAC8C\uB2E4\uAC00 \uB0B4\uAC00 \uC544\uBB34\uB9AC \uC606\uC5D0 \uB204\uAC00 \uC788\uC73C\uBA74 \uC798 \uC794\uB2E4\uACE0\uB294 \uD574\uB3C4, \uADF8\uB798\uB3C4 \uB0A8\uB4E4\uBCF4\uB2E4\uB294 \uB35C \uC790\uB294 \uD3B8\uC774\uB77C\uC11C... \uB0B4\uAC00 \uB2A6\uAC8C\uAE4C\uC9C0 \uB4A4\uCC99\uAC70\uB9AC\uAC70\uB098, \uB108\uBB34 \uC77C\uCC0D \uC77C\uC5B4\uB098\uC11C \uAF3C\uC9C0\uB77D\uAC70\uB9AC\uBA74 \uC880 \uBBF8\uC548\uD558\uB2E4.\n\n\uB0B4\uAC00 \uD56D\uC0C1 \uC7A0\uC774 \uBD80\uC871\uD55C \uC0B6\uC744 \uC0B4\uB2E4\uBCF4\uB2C8, \uB0A8\uC758 \uC7A0\uB3C4 \uC18C\uC911\uD55C \uAC83\uC744 \uC54C\uACA0\uB354\uB77C\uACE0..",
