  "text" : "\uADFC\uB370 \uB610 \uAC1C\uC911\uC5D0\uB294 \uBAB8\uC774 \uC815\uB9D0 \uC544\uD508\uB370 \"\uBCF8\uC778\uC774 \uAD70\uB300\uB97C \uAC00\uACE0 \uC2F6\uC5B4\uC11C + \uBD80\uBAA8\uB2D8\uAED8\uC11C \uAD70\uC785\uB300\uB97C \uAC15\uB825\uD788 \uAD8C\uC720\uD574\uC11C\" \uBE7D\uC744 \uC368\uC11C\uB77C\uB3C4 \uC785\uB300\uD558\uB294 \uACBD\uC6B0\uB3C4 \uC885\uC885 \uC788\uC5C8\uB2E4. \uC544\uBB34\uB9AC \uBAB8\uC774 \uC544\uD504\uB354\uB77C\uB3C4, \uBD80\uBAA8\uB2D8\uC758 \uD074\uB798\uC2A4\uB9CC \uB41C\uB2E4\uBA74 \uAD70\uC0DD\uD65C\uC744 \uC27D\uACE0 \uD3B8\uD558\uAC8C \uD560 \uC218 \uC788\uB294 \uBC29\uBC95\uC740 \uB9CE\uC558\uC73C\uB2C8\uAE4C",
