  "text" : "\uC560\uB4E4\uC774\uB791 \uC774\uC57C\uAE30\uB97C \uD558\uB2E4\uBCF4\uBA74 \uC885\uC885 \"\uC8FC\uBCC0 \uC0AC\uB78C\uB4E4\uC758 \uC785\uB300\uB97C \uD53C\uD558\uB294 \uBC29\uBC95\"\uB4E4\uC774 \uD654\uB450\uC5D0 \uC624\uB974\uAE30 \uB9C8\uB828\uC778\uB370, \uC9C4\uC9DC \uB514\uD14C\uC77C\uD558\uAC8C \uC798 \uB4E4\uC5C8\uB2E4. \uC5B8\uB860\uC5D0 \uBCF4\uB3C4\uB418\uC9C0 \uC54A\uC740 \uC774\uC57C\uAE30\uB4E4\uB3C4 \uB9CE\uC774 \uC788\uC5C8\uACE0. \uB0B4\uAC00 \uADF8\uB54C \uC774\uD6C4\uBD80\uD130 \uAD70\uBA74\uC81C\uB97C \uC880 \uAE4C\uB2E4\uB86D\uAC8C \uBCF4\uAE30 \uC2DC\uC791\uD568. \uC0DD\uAC01\uBCF4\uB2E4 \uC27D\uB358\uB370..",
