  "text" : "\uB77C\uB514\uC624\uB294 \uC2DC\uAC04 \uB9DE\uCDB0\uC11C \uBCF8\uBC29\uC0AC\uC218 \uBABB\uD558\uBA74 \uADF8\uB0E5 \uADF8\uB300\uB85C \uB05D. \uB0B4\uAC8C \uD2B8\uC704\uD130\uB294 \uB77C\uB514\uC624 \uAC19\uC740 \uC18C\uD1B5\uC218\uB2E8.\n\n\uADF8\uB798\uB3C4 \uC815\uB9D0 \uAD81\uAE08\uD55C \uC0AC\uB78C\uB4E4\uC740 \uB9AC\uC2A4\uD2B8 \uB9CC\uB4E4\uC5B4\uC11C \uAF3C\uAF3C\uD558\uAC8C \uAD6C\uB3C5\uD558\uACE0, \uB54C\uB85C\uB294 \uC54C\uB78C\uAE4C\uC9C0 \uC9C0\uC815\uD574\uC11C \uD655\uC778\uD574\uC694. \uB108 \uB9D0\uC774\uC57C \uC774\uC05C\uC774 \uB108 \uB108 *-_-*",
