  "text" : "\uB0B4\uAC8C \uD2B8\uC704\uD130\uB294 \uC544\uBB34\uB798\uB3C4 \uC798 \uBAA8\uB974\uB294 \uC0AC\uB78C\uB4E4\uACFC\uC758 \uC18C\uD1B5\uC774\uB2E4\uBCF4\uB2C8, \uCE74\uCE74\uC624 \uC2A4\uD1A0\uB9AC \uB9CC\uD07C\uC758 \uBC00\uCC29\uAC10\uC774 \uC5C6\uB2E4. \uCE74\uC2A4\uB294 \uB2F5\uAE00\uB3C4 \uCC38 \uC5F4\uC2EC\uD788 \uB2EC\uC544\uC8FC\uB294\uB370, \uD2B8\uC704\uD130\uB294 \uD478\uC26C\uC54C\uB78C \uC790\uCCB4\uB97C \uAEBC\uB193\uC74C. \uCE74\uCE74\uC624 \uC2A4\uD1A0\uB9AC\uB294 \uB0B4\uAC00 \uBABB \uBCF8 \uAE00\uB4E4\uAE4C\uC9C0 \uC815\uB3C5\uD558\uB294\uB370, \uD2B8\uC704\uD130\uB294 \uADF8\uB0E5 \uB77C\uB514\uC624 \uBC29\uC1A1\uC758 \uB290\uB08C",
