  "text" : "(\uC77C\uBC18\uC801\uC73C\uB85C) \uD615\uBC95\uC5D0\uC11C \uC0AC\uB78C\uC740 \uC790\uAE30\uAC00 \uC778\uC2DD\uD558\uACE0 \uC758\uB3C4\uD55C \uB9CC\uD07C, \uADF8\uB9AC\uACE0 \uC774\uC5D0 \uAE30\uBC18\uD558\uC5EC \uD589\uD55C \uB9CC\uD07C\uB9CC \uCC45\uC784\uC744 \uC9C0\uAC8C \uB418\uC5B4 \uC788\uC2B5\uB2C8\uB2E4.\n\n\uBC94\uC8C4\uC790\uB294 \uC790\uC2E0\uC774 \uC800\uC9C0\uB974\uC9C0 \uC54A\uC740 \uC8C4\uAE4C\uC9C0 \uBAA8\uB450 \uB5A0\uC548\uACE0 \uAC00\uC2E0 \uC608\uC218\uB2D8\uC774 \uC544\uB2C8\uB2C8\uAE4C\uC694(?)",
