  "text" : "\uC77C\uBC18\uC778\uC774\uB77C\uACE0 \uC778\uC2DD\uD588\uACE0, \uC774\uB7EC\uD55C \uCC29\uC624\uC5D0 \uAE30\uBC18\uD558\uC5EC \uBCF4\uD1B5\uC0B4\uC778\uC758 \uACE0\uC758\uB85C \uC0B4\uD574\uD589\uC704\uB97C \uD558\uC600\uC73C\uBBC0\uB85C, \uC124\uC0AC \uADF8 \uD53C\uD574\uC790\uAC00 \uC77C\uBC18\uC778\uC774 \uC544\uB2CC \uC790\uC2E0\uC758 \uC9C1\uACC4\uC874\uC18D\uC774\uC5C8\uB2E4\uACE0 \uD558\uB354\uB77C\uB3C4 \uC774\uB97C \uC874\uC18D\uC0B4\uC778\uC8C4(7\uB144 \uC774\uC0C1 \uC9D5\uC5ED)\uB85C \uCC98\uBC8C\uD560 \uC218\uB294 \uC5C6\uACE0 (\uBCF4\uD1B5)\uC0B4\uC778\uC8C4(5\uB144 \uC774\uC0C1 \uC9D5\uC5ED)\uB85C \uCC98\uBC8C\uD55C\uB2E4.\"",
