  "text" : "\uCEF4\uD4E8\uD130\uB791 \uC704, TV, \uB0C9\uC7A5\uACE0 \uC74C\uB8CC\uC218 \uC774\uB534\uAC70 \uC5C6\uC5B4\uB3C4 \uB418\uB2C8\uAE4C... \uBC29\uC5D0 \uCE68\uB300\uB791 \uC218\uAC74, \uC0E4\uC6CC\uBD80\uC2A4\uB9CC \uB531 \uAD6C\uBE44\uB418\uC5B4 \uC788\uB294 \uBC18\uAC12\uBAA8\uD154 \uC788\uC5C8\uC73C\uBA74 \uC88B\uACA0\uB2E4.\n\n\uD504\uB85C\uD14D\uD130\uB294 \uAC01\uC790 \uC54C\uC544\uC11C \uCC59\uACA8\uC624\uC2DC\uACE0-",
