  "text" : "\uB300\uBD80\uBD84\uC758 \uC8FC\uC694 \uAD6D\uAC00\uB4E4\uC740 \uBCF8\uC778\uD655\uC778\uC81C\uC640 \uAC19\uC740 \uC801\uADF9\uC801\uC778 \uAC8C\uC2DC\uD310 \uC774\uC6A9\uADDC\uC81C\uB97C \uC2DC\uD589\uD558\uACE0 \uC788\uC9C0 \uC54A\uB2E4. \n\n\uC9C0\uAE08\uAE4C\uC9C0 \uC81C\uAC00 \uC4F4 \uB9D0\uB4E4\uC694? \uC9C0\uB09C\uD574 \uB098\uC654\uB358 \uD5CC\uBC95\uC7AC\uD310\uC18C\uC758 \uC778\uD130\uB137\uC2E4\uBA85\uC81C \uC704\uD5CC\uD310\uB840\uC5D0\uC11C \uB098\uC628 \uB0B4\uC6A9\uC744 \uADF8\uB300\uB85C \uC778\uC6A9\uD55C\uAC81\uB2C8\uB2E4. \uADF8\uB550 \uB2E4\uB4E4 \"\uD45C\uD604\uC758 \uC790\uC720 \uB9CC\uC138!\"\uB97C \uC678\uCCE4\uC9C0..",
