  "text" : "\uC720\uB7FD\uC758 \uB9CE\uC740 \uAD6D\uAC00\uB4E4 \uC5ED\uC2DC \uBBFC\uAC04 \uC8FC\uB3C4\uC758 \uC790\uC728\uADDC\uC81C\uB97C \uAE30\uCD08\uB85C \uC778\uD130\uB137\uC11C\uBE44\uC2A4 \uC81C\uACF5\uC790\uC758 \uCC45\uC784\uC81C\uD55C\uC774\uB098 \uBA74\uCC45\uC694\uAC74\uC744 \uC815\uD558\uB294 \uBC29\uC2DD\uC73C\uB85C \uAD00\uACC4 \uBC95\uB839\uC744 \uC218\uB9BD\uD558\uACE0 \uC788\uC73C\uBA70, \uC77C\uBCF8\uC758 \uACBD\uC6B0\uC5D0\uB3C4 \uBD88\uBC95\u00B7\uC720\uD574\uC815\uBCF4\uAC00 \uAC8C\uC2DC\uB418\uB294 \uB54C\uC5D0 \uBBFC\uAD00\uC774 \uD611\uC870\uD558\uC5EC \uC0AC\uD6C4\uC801\uC73C\uB85C \uB300\uCC98\uD558\uB3C4\uB85D \uADDC\uC728\uD558\uACE0 \uC788\uB294 \uB4F1",
