  "text" : "(\uB3D9\uBC95 \uC81C44\uC870\uC7587 \uC81C2\uD56D, \uC81C3\uD56D) \uB4F1\uC73C\uB85C \uBD88\uBC95\uC815\uBCF4\uC758 \uC720\uD1B5 \uBC0F \uD655\uC0B0\uC744 \uCC28\uB2E8\uD558\uAC70\uB098 \uC0AC\uD6C4\uC801\uC73C\uB85C \uC190\uD574\uBC30\uC0C1 \uB610\uB294 \uD615\uC0AC\uCC98\uBC8C \uB4F1\uC758 \uBC29\uBC95\uC744 \uD1B5\uD558\uC5EC \uCDA9\uBD84\uD788 \uB2EC\uC131\uD560 \uC218 \uC788\uB2E4. \uBBF8\uAD6D, \uC601\uAD6D\uC758 \uACBD\uC6B0 \uC778\uD130\uB137\uC0C1 \uC720\uD574 \uC815\uBCF4\uC5D0 \uB300\uD55C \uADDC\uC81C\uB97C \uC6D0\uCE59\uC801\uC73C\uB85C \uC5C5\uACC4 \uC790\uC728\uC5D0 \uB9E1\uAE30\uACE0 \uC788\uACE0,",
