  "text" : "\uAC8C\uC2DC\uD310\uC5D0 \uAC8C\uC2DC\uB41C \uC815\uBCF4\uB85C \uC778\uD558\uC5EC \uAD8C\uB9AC\uAC00 \uCE68\uD574\uB41C \uC790\uC5D0 \uB300\uD55C \uAD6C\uC81C\uB294 \uC815\uBCF4\uD1B5\uC2E0\uC11C\uBE44\uC2A4 \uC81C\uACF5\uC790\uC5D0 \uC758\uD55C \uB2F9\uD574 \uC815\uBCF4\uC758 \uC0AD\uC81C\u00B7\uC784\uC2DC\uC870\uCE58(\uC815\uBCF4\uD1B5\uC2E0\uB9DD\uBC95 \uC81C44\uC870\uC7582 \uC81C1\uD56D, \uC81C2\uD56D), \uAC8C\uC2DC\uD310 \uAD00\uB9AC\u00B7\uC6B4\uC601\uC790\uC5D0 \uB300\uD55C \uBD88\uBC95\uC815\uBCF4 \uCDE8\uAE09\uC758 \uAC70\uBD80\u00B7\uC815\uC9C0 \uB610\uB294 \uC81C\uD55C\uBA85\uB839",
