  "text" : "\uADF8\uAC83\uC774 \uAC16\uB294 \uD5CC\uBC95\uC801 \uAC00\uCE58\uC5D0 \uBE44\uCD94\uC5B4 \uAC15\uD558\uAC8C \uBCF4\uD638\uB418\uC5B4\uC57C \uD55C\uB2E4. \uD45C\uD604\uC758 \uC790\uC720\uB294 \uBBFC\uC8FC\uC8FC\uC758\uC758 \uADFC\uAC04\uC774 \uB418\uB294 \uC911\uC694\uD55C \uD5CC\uBC95\uC801 \uAC00\uCE58\uC774\uBBC0\uB85C \uD45C\uD604\uC758 \uC790\uC720\uC758 \uC0AC\uC804 \uC81C\uD55C\uC744 \uC815\uB2F9\uD654\uD558\uAE30 \uC704\uD574\uC11C\uB294 \uADF8 \uC81C\uD55C\uC73C\uB85C \uC778\uD558\uC5EC \uB2EC\uC131\uD558\uB824\uB294 \uACF5\uC775\uC758 \uD6A8\uACFC\uAC00 \uBA85\uBC31\uD558\uC5EC\uC57C \uD55C\uB2E4.",
