  "text" : "\uAD6D\uAC00\uC758 \uC815\uCC45\uACB0\uC815\uC5D0 \uBC18\uC601\uB420 \uAC00\uB2A5\uC131\uC744 \uC5F4\uC5B4 \uC900\uB2E4\uB294 \uC810\uC5D0\uC11C \uD45C\uD604\uC758 \uC790\uC720\uC758 \uB0B4\uC6A9\uC5D0\uC11C \uBE7C\uB193\uC744 \uC218 \uC5C6\uB294 \uAC83\uC774\uB2E4. \uADF8\uB9AC\uACE0 \uC778\uD130\uB137 \uACF5\uAC04\uC5D0\uC11C \uC774\uB8E8\uC5B4\uC9C0\uB294 \uC775\uBA85\uD45C\uD604\uC740 \uC778\uD130\uB137\uC774 \uAC00\uC9C0\uB294 \uC815\uBCF4\uC804\uB2EC\uC758 \uC2E0\uC18D\uC131 \uBC0F \uC0C1\uD638\uC131\uACFC \uACB0\uD569\uD558\uC5EC \uD604\uC2E4 \uACF5\uAC04\uC5D0\uC11C\uC758 \uACBD\uC81C\uB825\uC774\uB098",
