  "text" : "\uC2DD\uCE7C\uC774 \uBC94\uD589\uB3C4\uAD6C\uB85C \uC0AC\uC6A9\uB418\uC5C8\uB2E4\uACE0 \uD574\uC11C \uC774\uB97C \uD310\uB9E4\uD55C \uC8FC\uBC29\uC6A9\uD488\uC810 \uC790\uCCB4\uB97C \uD3D0\uC1C4\uC2DC\uD0AC \uC218\uB294 \uC5C6\uB294 \uB178\uB987 \uC544\uB2C8\uACA0\uC2B5\uB2C8\uAE4C. \uBC94\uD589\uC5D0 \uC0AC\uC6A9\uB420 \uAC83\uC784\uC744 \uC54C\uBA74\uC11C\uB3C4 \uC774\uB97C \uD310\uB9E4, \uBC94\uD589\uC744 \uBC29\uC870\uD588\uB2E4\uBA74 \uBAA8\uB97C\uAE4C \uB9D0\uC774\uC8E0. \uC77C\uBCA0 \uADF8 \uC790\uCCB4\uC5D0\uB294 \uC815\uBCF4\uD1B5\uC2E0\uC11C\uBE44\uC2A4 \uC81C\uACF5\uC790\uC758 \uC758\uBB34\uD574\uD0DC\uB97C \uBB3B\uB294 \uAC83\uC73C\uB85C \uCDA9\uBD84",
