  "text" : "\uC774\uB294 \uBD84\uBA85 \uBBFC\uD615\uC0AC\uC0C1 \uCC45\uC784\uC744 \uBB3C\uC5B4\uC57C \uD558\uB294- \uBCF4\uD638\uC601\uC5ED\uC744 \uBC97\uC5B4\uB09C \uD45C\uD604\uB4E4\uC784\uC740 \uBD84\uBA85\uD558\uC8E0. \uD5C8\uB098, \uC774\uB7EC\uD55C \uCC45\uC784\uC740 \uC5B4\uB514\uAE4C\uC9C0\uB098 \uADF8\uB7EC\uD55C \uBD88\uBC95\uD589\uC704\uB97C \uD55C \uAC1C\uAC1C\uC778\uC5D0\uAC8C \uBB3C\uC5B4\uC57C\uC9C0, \uADF8\uB7EC\uD55C \uAE00\uB4E4\uC774 \uC62C\uB77C\uC654\uB2E4\uACE0 \uD574\uC11C \uC0AC\uC774\uD2B8 \uC6B4\uC601 \uC790\uCCB4\uB97C \uB9C9\uC544\uBC84\uB9AC\uB294 \uADF9\uB2E8\uC801\uC778 \uBC29\uBC95\uC73C\uB85C \uBB3C\uC5B4\uC120 \uC548\uB429\uB2C8\uB2E4.",
