  "text" : "\uB9D0\uC774 \uC5C4\uD55C \uACF3\uC73C\uB85C \uC0DC\uB294\uB370.. \uC704\uBC95\uD589\uC704\uB97C \uD55C \uAD6C\uC131\uC6D0 \uAC1C\uC778\uC758 \uCC45\uC784\uC73C\uB85C \uBB3C\uC5B4\uC57C\uC9C0, \uC77C\uBCA0\uC758 \uC874\uC7AC \uADF8 \uC790\uCCB4\uC5D0 \uCC45\uC784\uC744 \uBB3C\uC5B4 \uC0AC\uC774\uD2B8 \uC790\uCCB4\uB97C \uB9D0\uC0B4\uD558\uB824 \uB4DC\uB294 \uAC83\uC740 \uC815\uB9D0 \uC704\uD5D8\uD568. \uC77C\uBCA0 \uADF8 \uC790\uCCB4\uB294 \uC874\uC18D\uC2DC\uD0A4\uB418, \uC6B4\uC601\uC790\uC758 \uAD00\uB9AC\uC5D0 \uB300\uD55C \uCC45\uC784\uB9CC \uBB3B\uB294 \uBC29\uC2DD\uC73C\uB85C\uB3C4 \uCDA9\uBD84\uD788 \uC81C\uD55C \uAC00\uB2A5",
