  "text" : "\uC5C4\uC5F0\uD788 \uC790\uAE30 \uC0B6\uC774 \uC788\uB294 \uC0AC\uB78C\uB4E4\uC758 \uC0AC\uC9C4 \uD37C\uC640\uC11C \uAC70\uAE30\uB2E4\uAC00 \uC131\uAD34\uB124 \uBB50\uB124 \uC774\uB7EC\uBA74\uC11C \uACF5\uAC1C\uC801\uC73C\uB85C \uB3CC\uB824\uBCF4\uB294\uAC74 \uBCF4\uD638\uBC1B\uC544\uC57C \uD558\uB294 \uD45C\uD604\uC758 \uC790\uC720\uB77C\uACE0 \uC0DD\uAC01\uD558\uB294 \uAC83\uC784? \uB0B4\uAC00 \uD558\uBA74 \uD45C\uD604\uC758 \uC790\uC720\uC758 \uB9CC\uB07D\uC774\uACE0, \uB0A8\uC774 \uD558\uB294 \uD45C\uD604\uC740 \uBC29\uC885\uC774\uB77C\uB294 \uB9C8\uC778\uB4DC\uB3C4 \uC77C\uBCA0\uC758 \uC874\uC7AC\uB9CC\uD07C\uC774\uB098 \uC704\uD5D8\uD568.",
