  "text" : "\uC0B4\uACE0 \uC788\uB294 \uC9D1\uC5D0 \uBC14\uD034\uBC8C\uB808\uAC00 \uB9CE\uC774 \uB098\uC628\uB2E4\uACE0 \uD574\uC11C, \uC9D1\uC744 \uC644\uC804\uD788 \uBD80\uC234\uBC84\uB9B4 \uAC83\uC784? \uADF8\uBCF4\uB2E4\uB294 \uC804\uBB38\uC801\uC778 \uBC29\uC5ED\uC5C5\uCCB4\uB97C \uBD88\uB7EC\uC11C \uC9D1\uC744 \uAF3C\uAF3C\uD558\uAC8C \uBD84\uC11D\uD55C \uB4A4, \uBC14\uD034\uBC8C\uB808\uAC00 \uC8FC\uB85C \uC11C\uC2DD\uD558\uB294 \uD658\uACBD \uBC0F \uBC88\uC2DD\uB8E8\uD2B8\uB97C \uD30C\uC545\uD558\uACE0 \uBC29\uC5ED\uC791\uC5C5\uC744 \uD1B5\uD574 \uBC15\uBA78\uC744 \uD574\uC57C\uC9C0. \uADF8\uAC74 \uC77C\uBCA0\uB3C4 \uB9C8\uCC2C\uAC00\uC9C0.",
