  "text" : "\uADF8\uB3D9\uC548 \uD0C0\uC784\uB77C\uC778\uC5D0\uC11C \uD754\uD788 \uBD10\uC624\uB358 &lt;\uBCF4\uC218\uC815\uCE58\uC778\uC744 \uC695\uD558\uB294 \uC0AC\uB78C\uC5D0\uAC8C \uBA85\uC608\uD6FC\uC190 \uD610\uC758\uAC00 \uC50C\uC6CC\uC9C0\uC790 \"\uBA85\uC608\uD6FC\uC190\uC8C4\uB97C \uC5C6\uC560\uC57C \uD55C\uB2E4! \uC774\uB294 \uD45C\uD604\uC758 \uC790\uC720\uB97C \uC3FC\uB77C\uC3FC\uB77C\"&gt; \uD558\uB358 \uBD84\uB4E4\uC774 \uC77C\uBCA0\uC0AC\uD0DC(?)\uC5D0 \uB300\uD574\uC11C\uB294 \"\uC800\uB188\uB4E4 \uBA85\uC608\uD6FC\uC190\uC73C\uB85C \uB2E4 \uC7A1\uC544\uB123\uC5B4\uB77C\" \uB77C\uACE0 \uD558\uB294 \uAC83\uB3C4 \uBE14\uB799\uCF54\uBBF8\uB514.",
