  "text" : "\uC2DC\uC911\uC5D0 \uB098\uC640\uC788\uB294 \uD0DC\uC591\uAD11 \uCDA9\uC804\uD328\uB4DC\uB098 \uD578\uB4E4 \uBC1C\uC804\uAE30 \uB4F1\uC744 \uBCF4\uBA74, \uADF8 \uB0B4\uAD6C\uC131\uC774\uB77C\uB358\uAC00 \uC131\uB2A5\uC5D0 \uC758\uBB38\uC774 \uAC00\uB294 \uACBD\uC6B0\uAC00 \uB300\uBD80\uBD84\uC774\uB77C.. \uD578\uB4E4\uC744 \uD50C\uB77C\uC2A4\uD2F1 \uB9D0\uACE0, \uC880 \uBE44\uC2F8\uAC8C \uD314\uB354\uB77C\uB3C4 \uD2BC\uD2BC\uD55C \uBA54\uD0C8\uB85C \uB9CC\uB4E4\uC5B4\uC8FC\uBA74 \uC548\uB3FC?? \uD578\uB4E4 \uB3CC\uB9AC\uB2E4\uAC00 \uC544\uC791\uB0A0\uAE4C\uBD10 \uAD6C\uB9E4\uBC84\uD2BC\uC744 \uBABB\uB204\uB974\uACA0\uB2E4 -_-",
