  "text" : "\uC774\uB97C \uB09C\uD3ED\uD558\uAC8C \uC9C4\uC555\uD568\uC73C\uB85C\uC368, \uB300\uD1B5\uB839\uACFC \uAD6D\uBB34\uC704\uC6D0\uB4E4\uC5D0\uAC8C \uBCF4\uB2E4 \uAC15\uD55C \uC704\uD611\uC744 \uAC00\uD558\uC5EC \uADF8\uB4E4\uC744 \uC678\uD3EC\uD558\uAC8C \uD558\uC600\uB2E4\uBA74, \uADF8 \uC2DC\uC704\uC9C4\uC555\uD589\uC704\uB294 \uB0B4\uB780\uD589\uC704\uC790\uB4E4\uC774 \uD5CC\uBC95\uAE30\uAD00\uC778 \uB300\uD1B5\uB839\uACFC \uAD6D\uBB34\uC704\uC6D0\uB4E4\uC744 \uAC15\uC555\uD558\uC5EC \uADF8 \uAD8C\uB2A5\uD589\uC0AC\uB97C \uBD88\uAC00\uB2A5\uD558\uAC8C \uD55C \uAC83\uC73C\uB85C \uAD6D\uD5CC\uBB38\uB780\uC5D0 \uD574\uB2F9\uD55C\uB2E4. @seungow",
