  "text" : "\uADF8 \uC678\uC5D0\uB3C4 \uC544\uB3D9\uCCAD\uC18C\uB144\uC758 \uCE5C\uAD8C\uC790\uAC00 \uC131\uBC94\uC8C4\uB97C \uC800\uC9C8\uB800\uC744 \uB54C \uD544\uC694\uC801\uC73C\uB85C \uCE5C\uAD8C\uC0C1\uC2E4\uCCAD\uAD6C\uB97C \uD558\uAC8C \uD55C\uB2E4\uB358\uAC00, \uD53C\uD574\uC544\uB3D9\uCCAD\uC18C\uB144\uC758 \uBCF4\uD638\uB098 \uCE58\uB8CC\uC5D0 \uAD00\uD55C \uADDC\uC815\uAE4C\uC9C0 \uC704\uD5CC\uC73C\uB85C \uBCF8\uB2E4\uB294 \uC774\uC57C\uAE30\uB294 \uC544\uB2D0\uAEBC \uC544\uB2C8\uC5D0\uC694. \uADFC\uB370 \uC65C \uC790\uAFB8 \uC544\uCCAD\uBC95\uC744 \uC2F8\uC7A1\uC544\uC11C \uC704\uD5CC\uC774\uB77C\uACE0 \uD558\uC2DC\uB098\uC694? @seungow",
