  "text" : "\uC544\uB3D9\uCCAD\uC18C\uB144\uC5D0 \uB300\uD558\uC5EC \uD2B9\uC218\uAC15\uAC04\uC774\uB098 \uCE5C\uC871\uAC15\uAC04, \uAC15\uAC04\uC0C1\uD574\uCE58\uC0C1, \uAC15\uAC04\uC0B4\uD574\uCE58\uC0AC, \uCD94\uD589 \uB4F1\uC758 \uC131\uBC94\uC8C4\uB97C \uC800\uC9C0\uB978 \uC790\uAC00 \uC74C\uC8FC \uB610\uB294 \uC57D\uBB3C\uB85C \uC778\uD55C \uC2EC\uC2E0\uC7A5\uC560 \uC0C1\uD0DC\uC5D0\uC11C \uBC94\uD589\uC744 \uC800\uC9C8\uB800\uB354\uB77C\uB3C4 \uD615 \uAC10\uACBD\uC744 \uD560 \uC218 \uC5C6\uB3C4\uB85D \uD558\uB294 \uC870\uD56D \uC5ED\uC2DC \uC704\uD5CC\uC73C\uB85C \uBCF4\uC2E0\uB2E8 \uB9D0\uC778\uAC00\uC694\uB4E4? @seungow",
