  "text" : "\uB9D0\uC500\uD558\uC2DC\uB294 \uAC83\uCC98\uB7FC '\uC544\uCCAD\uBC95=\uC704\uD5CC'\uC73C\uB85C \uBCF4\uAC8C \uB41C\uB2E4\uBA74- \uC544\uB3D9\uCCAD\uC18C\uB144\uC5D0 \uB300\uD55C \uAC15\uAC04\uC774\uB098 \uAC15\uC81C\uCD94\uD589 \uB4F1\uC758 \uC131\uBC94\uC8C4\uC790\uC5D0 \uB300\uD55C \uACF5\uC18C\uC2DC\uD6A8 \uAE30\uC0B0\uC810\uC758 \uBCC0\uACBD\uC774\uB77C\uB358\uAC00, \uACF5\uC18C\uC2DC\uD6A8 \uC5F0\uC7A5\uC774\uB77C\uB358\uAC00, \uD615\uC18C\uBC95\uC0C1 \uACF5\uC18C\uC2DC\uD6A8\uADDC\uC815\uC758 \uC801\uC6A9 \uBC30\uC81C \uB4F1\uC744 \uD560 \uC218 \uC788\uB294 \uACF5\uC18C\uC2DC\uD6A8 \uD2B9\uB840\uADDC\uC815\uB3C4 \uC704\uD5CC\uC774 \uB418\uACA0\uAD6C\uC694",
