  "text" : "\uC608\uC804\uC5D0\uB3C4 \uB9D0\uD588\uB2E4\uC2DC\uD53C, \uB098\uB294 \uC544\uCCAD\uBC95\uC0C1 '\uC544\uB3D9\uCCAD\uC18C\uB144\uC774\uC6A9\uC74C\uB780\uBB3C\uC758 \uC815\uC758'\uC870\uD56D\uC774 \uC544\uB2CC \uC544\uCCAD\uBC95 \uC804\uCCB4\uB97C \uBB36\uC5B4 \uBE44\uD310\uD558\uB294 \uAC83\uC5D0 \uB300\uD574 \uD070 \uBD88\uD3B8\uD568\uC744 \uB290\uB080\uB2E4. \uC81C\uBC1C \uBD80\uD0C1\uC778\uB370, \uC544\uB3D9 \uBC0F \uCCAD\uC18C\uB144\uC758 \uC131\uBCF4\uD638\uC5D0 \uAD00\uD55C \uBC95\uB960\uC5D0\uC11C \uCCAD\uC18C\uB144\uC774\uC6A9\uC74C\uB780\uBB3C\uC758 \uC815\uC758\uC870\uD56D\uB9CC \uBD84\uB9AC\uD574\uC11C \uBE44\uD310\uD558\uBA74 \uC548\uB420\uAE4C\uC694.",
