  "text" : "\uCC38\uACE0\uB85C \uB0B4 \uACBD\uD5D8\uC5D0 \uC758\uD558\uBA74.. \uADF8\uB7F0 \uD3ED\uC5B8\uC744 \uD560 \uC218 \uC788\uB294 \uC0AC\uB78C\uB4E4\uC744 \uB9C9\uC0C1 \uAE4C\uB193\uACE0 \uBCF4\uBA74 \uB0A8\uC5D0\uAC8C \uD070\uC18C\uB9AC \uCE58\uAE30 \uBB63\uD55C \uD559\uB825\uC774\uB098 \uD559\uBC8C, \uC9C1\uC5C5\uC744 \uAC00\uC9C0\uACE0 \uC788\uB294 \uACBD\uC6B0\uAC00 \uB9CE\uC558\uC74C. \uC790\uACA9\uC9C0\uC2EC\uC758 \uBC1C\uD604\uC774\uB77C\uACE0\uB098 \uD560\uAE4C? \uBCC4\uBCFC\uC77C \uC5C6\uB294 \uD604\uC2E4\uC5D0\uC11C \uB3C4\uD53C\uD0A4 \uC704\uD574 \uACF5\uC0C1\uD5C8\uC5B8\uC99D\uC5D0 \uBE60\uC838\uBC84\uB9AC\uB294 \uCF00\uC774\uC2A4",
