  "text" : "\uACA8\uC6B0\uACA8\uC6B0 \uC870\uB974\uACE0 \uC878\uB77C \uB17C\uC0B0\uC721\uAD70\uBCD1\uC6D0\uC5D0 \uAC14\uB294\uB370, \uB538\uB791 \uC18C\uC5FC\uC81C \uD558\uB098 \uC8FC\uB354\uAD70\uC694. \uCE58\uACFC\uC758\uC0AC\uC778 \uCE5C\uB204\uB098\uAC00 \uC2A4\uCF00\uC77C\uB9C1 \uCE58\uB8CC \uBC1B\uC73C\uB77C\uACE0 \uD558\uAE38\uB798 \uC2A4\uCF00\uC77C\uB9C1 \uC774\uC57C\uAE30 \uAEBC\uB0C8\uB2E4\uAC00 \uAD70\uC758\uAD00\uD55C\uD14C \uAE4C\uC600\uC5B4\uC694. '\uC721\uAD70\uBCD1\uC6D0\uC774 \uB2C8 \uC2A4\uCF00\uC77C\uB9C1 \uD574\uC8FC\uB294 \uACF3\uC778\uC904 \uC544\uB290\uB0D0. \uC6B0\uB9B0 \uBC14\uC058\uB2E4-'\uB77C\uB2C8.. \uAC1C\uC0C8, \uD655",
