  "text" : "\uC0AC\uC2E4 \uBBFC\uC8FC\uB2F9\uC758 \uD0DC\uB3C4\uB3C4 \uC774\uD574\uAC00 \uAC04\uB2E4. \uCC28\uBCC4\uAE08\uC9C0\uBC95 \uC81C\uC815\uC5D0 \uCC2C\uC131\uD558\uB294 \uC720\uAD8C\uC790\uB4E4\uC774 \uB099\uC120\uC6B4\uB3D9 \uB4F1\uC758 \uC870\uC9C1\uB41C \uD798\uC744 \uBCF4\uC5EC\uC8FC\uB294 \uAC83\uB3C4 \uC544\uB2C8\uACE0, \uADF8\uB807\uB2E4\uACE0 \uB3C8\uC774 \uB418\uB294 \uAC83\uB3C4 \uC544\uB2C8\uACE0.. \uBBFC\uC8FC\uB2F9\uC740 \uB354 \uC911\uC694\uD558\uB2E4\uACE0 \uC0DD\uAC01\uB418\uB294 \uC720\uAD8C\uC790\uB97C \uC120\uD0DD\uD55C\uAC70\uC9C0 \uBB50.. \uC6B0\uB9AC\uB294 \uC788\uC73C\uB098 \uB9C8\uB098 \uD55C \uACE0\uAC1D\uC784\uC694.",
